import React from 'react'
import Sidebar from '../../components/Sidebar/Sidebar'

export default function Manage() {

    const sidebar = [
        {Home : 'fa-home'},
        {

            Workshop : 'fa-user-friends'
        }
    ]

    return (
        <>
        <Sidebar sidebar/>
        <div>
            <h1>Workshop</h1>
        </div>
        </>
    )
}
